//LINK
//import { Link } from "react-router-dom";

//STYLE
import style from '../../views/Home/Home.module.css';

export default function Home () {
    return (
       <div className={style.container}>

         <Header/>  

         <NavBar/>

         <Cards/>

       </div>
    );
};


